INSERT INTO `tools_info` VALUES ('1', 'tools/urlEncode', '/WEB-INF/view/tools/url_encode.jsp', 'Url编码转换工具', 'url编码是一种浏览器用来打包表单输入的格式。浏览器从表单中获取所有的name和其中的值 ，将它们以name/value参数编码（移去那些不能传送的字符，将数据排行等等）作为URL的一部分或者分离地发给服务器。', 'images/url.jpg');
INSERT INTO `tools_info` VALUES ('2', 'tools/easeEcode', '/WEB-INF/view/tools/base_encode.jsp', 'Base64编码转换', 'Base64是网络上最常见的用于传输8Bit字节码的编码方式之一，Base64就是一种基于64个可打印字符来表示二进制数据的方法。可查看RFC2045～RFC2049，上面有MIME的详细规范。', 'images/base64.jpg');
INSERT INTO `tools_info` VALUES ('3', 'tools/jsonFormat', '/WEB-INF/view/tools/json_format.jsp', 'Json格式化', 'JSON(JavaScript Object Notation, JS 对象标记) 是一种轻量级的数据交换格式。它基于 ECMAScript (w3c制定的js规范)的一个子集，采用完全独立于编程语言的文本格式来存储和表示数据。简洁和清晰的层次结构使得 JSON 成为理想的数据交换语言。 易于人阅读和编写，同时也易于机器解析和生成，并有效地提升网络传输效率。', 'images/json.jpg');
